import React from 'react';
import {Link} from 'react-router-dom';

function Navbar(){
    return(
        <nav className='navbar'>
            <h1> Sunshine Avenue </h1> 
            <div className='links'>
                <Link to="/" > home </Link>
                <a href="/prediction"> prediction </a>
            </div>
        </nav>
    )
}

export default Navbar;
